    <Flex width="300px" align="center" justify="center" height="600px">
      <SimpleGrid columns={3} spacing={2}>
        <Box width="100px" height="100px" textAlign="center">
          1
        </Box>
        <Box>2</Box>
        <Box>3</Box>
        <Box>4</Box>
        <Box>5</Box>
        <Box>6</Box>
        <Box>7</Box>
        <Box>8</Box>
        <Box>9</Box>
        <Box>0</Box>
      </SimpleGrid>
    </Flex>
  );
}
